Teman-teman pasti sudah tahu kan, kalo di zaman sekarang ini kita harus benar-benar bisa menjaga imun tubuh. Apalagi sekarang kan sedang banyak-banyaknya virus yang dengan mudahnya dapat masuk ke dalam tubuh kita. 
Nah salah satu cara untuk menghindari virus-virus tersebut yaitu dengan meningkatkan daya tahan tubuh atau imun. 

Btw, makanan/minuman apa aja sih yang mengandung imun? 

Sudah pastinya yang herbal, dan benar-benar herbal 100% tanpa bahan kimia ya. 
Beberapa diantaranya yaitu : Jahe dan Kunyit.

Meski bernunasa tradisional, Jahe dan Kunyit memiliki khasiat yang luar biasa untuk kesehatan tubuh manusia.

Selain menjadi bumbu dapur, Jahe dan Kunyit bisa diracik menjadi ramuan obat.

Jahe dan Kunyit adalah minuman rendah kalori dan kafein yang lezat dan sehat dan memiliki beragam manfaat, seperti:
1. Meningkatkan imun
2. Melancarkan pencernaan
3. Melawan peradangan
4. Menambah kesehatan Jantung
5. Menjadi obat tradisional untuk pilek dan mual
6. Meringankan rasa sakit
7. Mengurangi stress. Dan masih banyak lagi kemanfaatan lainnya dari Kunyit dan Jahe ini. 

